import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { petsAPI } from '../services/api';
import { useAuth } from '../context/AuthContext';
import PetCard from '../components/pets/PetCard';
import PetForm from '../components/pets/PetForm';
import './MyPets.css';

const MyPets = () => {
    const { currentUser } = useAuth();
    const [pets, setPets] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');
    const [showForm, setShowForm] = useState(false);
    const [editingPet, setEditingPet] = useState(null);

    useEffect(() => {
        fetchPets();
    }, []);

    const fetchPets = async () => {
        try {
            const data = await petsAPI.getMyPets();
            setPets(data);
        } catch (error) {
            setError('–û—à–∏–±–∫–∞ –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ –ø–∏—Ç–æ–º—Ü–µ–≤');
        } finally {
            setLoading(false);
        }
    };

    const handleAddPet = () => {
        setEditingPet(null);
        setShowForm(true);
    };

    const handleEditPet = (pet) => {
        setEditingPet(pet);
        setShowForm(true);
    };

    const handleFormClose = () => {
        setShowForm(false);
        setEditingPet(null);
    };

    const handleFormSubmit = async (petData) => {
        try {
            if (editingPet) {
                await petsAPI.updatePet(editingPet.id, petData);
            } else {
                await petsAPI.addPet(petData);
            }
            await fetchPets();
            setShowForm(false);
            setEditingPet(null);
        } catch (error) {
            setError(error.response?.data?.message || '–û—à–∏–±–∫–∞ –ø—Ä–∏ —Å–æ—Ö—Ä–∞–Ω–µ–Ω–∏–∏ –ø–∏—Ç–æ–º—Ü–∞');
        }
    };

    const handleDeletePet = async (petId) => {
        if (window.confirm('–í—ã —É–≤–µ—Ä–µ–Ω—ã, —á—Ç–æ —Ö–æ—Ç–∏—Ç–µ —É–¥–∞–ª–∏—Ç—å —ç—Ç–æ–≥–æ –ø–∏—Ç–æ–º—Ü–∞?')) {
            try {
                await petsAPI.deletePet(petId);
                await fetchPets();
            } catch (error) {
                setError('–û—à–∏–±–∫–∞ –ø—Ä–∏ —É–¥–∞–ª–µ–Ω–∏–∏ –ø–∏—Ç–æ–º—Ü–∞');
            }
        }
    };

    if (loading) return <div className="loading">–ó–∞–≥—Ä—É–∑–∫–∞ –ø–∏—Ç–æ–º—Ü–µ–≤...</div>;

    return (
        <div className="my-pets">
            <div className="container">
                <div className="page-header">
                    <h1>–ú–æ–∏ –ø–∏—Ç–æ–º—Ü—ã</h1>
                    <p>–£–ø—Ä–∞–≤–ª—è–π—Ç–µ –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–µ–π –æ –≤–∞—à–∏—Ö –ø–∏—Ç–æ–º—Ü–∞—Ö</p>
                    <button onClick={handleAddPet} className="btn btn-primary">
                        –î–æ–±–∞–≤–∏—Ç—å –ø–∏—Ç–æ–º—Ü–∞
                    </button>
                </div>

                {error && <div className="error-message">{error}</div>}

                {pets.length === 0 ? (
                    <div className="empty-state">
                        <div className="empty-icon">üêæ</div>
                        <h3>–£ –≤–∞—Å –ø–æ–∫–∞ –Ω–µ—Ç –ø–∏—Ç–æ–º—Ü–µ–≤</h3>
                        <p>–î–æ–±–∞–≤—å—Ç–µ –ø–µ—Ä–≤–æ–≥–æ –ø–∏—Ç–æ–º—Ü–∞, —á—Ç–æ–±—ã –Ω–∞—á–∞—Ç—å –æ—Ç—Å–ª–µ–∂–∏–≤–∞—Ç—å –µ–≥–æ –∑–¥–æ—Ä–æ–≤—å–µ –∏ —É—Ö–æ–¥</p>
                        <button onClick={handleAddPet} className="btn btn-primary">
                            –î–æ–±–∞–≤–∏—Ç—å –ø–µ—Ä–≤–æ–≥–æ –ø–∏—Ç–æ–º—Ü–∞
                        </button>
                    </div>
                ) : (
                    <div className="pets-grid">
                        {pets.map((pet) => (
                            <PetCard
                                key={pet.id}
                                pet={pet}
                                onEdit={handleEditPet}
                                onDelete={handleDeletePet}
                            />
                        ))}
                    </div>
                )}

                {showForm && (
                    <PetForm
                        pet={editingPet}
                        onSubmit={handleFormSubmit}
                        onClose={handleFormClose}
                    />
                )}
            </div>
        </div>
    );
};

export default MyPets;
